#include <bits/stdc++.h>

using namespace std;

const int maxN = 1e6 + 10;

int n, m, a[maxN], b[1111][1111];

string s;

struct nodedata
{
    int op, cl;
};

struct ITtree
{
    nodedata IT[maxN * 4];

    nodedata comb(nodedata lef, nodedata rig)
    {
        nodedata res;
        res.cl = lef.cl;
        res.op = rig.op;
        if (lef.op > rig.cl)
            res.op += lef.op - rig.cl;
        else
            res.cl += rig.cl - lef.op;
        return res;
    }

    void build(int x, int l, int r)
    {
        if (l == r)
        {
            IT[x].op = IT[x].cl = 0;
            if (a[l] == 1)
                IT[x].op = 1;
            else
                IT[x].cl = 1;
            return;
        }
        int mid = (l + r) / 2;
        build(x*2, l, mid);
        build(x*2+1, mid+1, r);
        IT[x] = comb(IT[x*2], IT[x*2+1]);
    }

    void update(int x, int l, int r, int u)
    {
        if (u < l || r < u)
            return;
        if (l == u && u == r)
        {
            swap(IT[x].cl, IT[x].op);
            return;
        }
        int mid = (l + r) / 2;
        update(x*2, l, mid, u);
        update(x*2+1, mid+1, r, u);
        IT[x] = comb(IT[x*2], IT[x*2+1]);
    }

    nodedata query(int x, int l, int r, int u, int v)
    {
        if (v < l || r < u)
            return {0, 0};
        if (u <= l && r <= v)
            return IT[x];
        int mid = (l + r) / 2;
        return comb(query(x*2, l, mid, u, v), query(x*2+1, mid+1, r, u, v));
    }
} tree;

int main()
{
    ios_base::sync_with_stdio(0);
    cin.tie(0);
    cout.tie(0);
    if (fopen("FIXSTR.INP", "r"))
    {
        freopen("FIXSTR.INP", "r", stdin);
        freopen("FIXSTR.OUT", "w", stdout);
    }
    cin >> s;

    n = s.length();

    for (int i=1; i<=n; ++i)
        if (s[i-1] == '(')
            a[i] = 1;
        else
            a[i] = -1;

    cin >> m;

    if (n <= 1000 && m <=1000)
    {

        for (int i=1; i<=n; ++i)
            b[0][i] = a[i];

        for (int t=1; t<=m; ++t)
        {
            for (int i=1; i<=n; ++i)
                b[t][i] = b[t-1][i];

            char type;
            cin >> type;

            if (type == 'C')
            {
                int u;
                cin >> u;
                b[t][u] = -b[t][u];
            }

            if (type == 'Q')
            {
                int u, v, ans = 0, sum = 0;
                cin >> u >> v;
                for (int i=u; i<=v; ++i)
                {
                    sum += b[t][i];
                    if (sum < 0)
                    {
                        ans += -sum;
                        sum = 0;
                    }
                }
                ans += sum;
                cout << ans << "\n";
            }

            if (type == 'U')
            {
                int u;
                cin >> u;
                for (int i=1; i<=n; ++i)
                    b[t][i] = b[u-1][i];
            }

//            for (int i=1; i<=n; ++i)
//                if (b[t][i] == 1)
//                    cout << "(";
//                else
//                    cout << ")";
//            cout << "\n";
        }
    }
    else
    {
        tree.build(1, 1, n);
        while (m--)
        {
            char type;
            cin >> type;

            if (type == 'C')
            {
                int u;
                cin >> u;
                tree.update(1, 1, n, u);
            }

            if (type == 'Q')
            {
                int u, v;
                cin >> u >> v;
                nodedata ans = tree.query(1, 1, n, u, v);
                cout << ans.cl + ans.op << "\n";
            }
        }
    }
}

